(11, '13024030663', 0, 'DO NOT ignore the negative comments!\nYou\'re going to get negative comments. That\'s a given when you\'re a business on social media. While most people ignore and block people who leave negative comments, it\'s best if you respond back in a way that either educates them (depending if they have their facts wrong), or respond in a way that helps better their customer experience.\n\nYou\'re going to deal with both positive comments (yay!) and negative (boo...), but it\'s important to never leave them ignored. Stay active, stay personable!\n\n#digitalmarketing #socialmediamarketing #smallbusinesstips #lehighvalley', '2025-08-08 13:50:00', '{\"id\":\"13024030663\",\"state\":\"SCHEDULED\",\"text\":\"DO NOT ignore the negative comments!\\nYou\'re going to get negative comments. That\'s a given when you\'re a business on social media. While most people ignore and block people who leave negative comments, it\'s best if you respond back in a way that either educates them (depending if they have their facts wrong), or respond in a way that helps better their customer experience.\\n\\nYou\'re going to deal with both positive comments (yay!) and negative (boo...), but it\'s important to never leave them ignored. Stay active, stay personable!\\n\\n#digitalmarketing #socialmediamarketing #smallbusinesstips #lehighvalley\",\"scheduledSendTime\":\"2025-08-08T17:50:00Z\",\"socialProfile\":{\"id\":\"139926693\",\"externalURL\":\"https:\\/\\/www.linkedin.com\\/company\\/15704389\"},\"mediaUrls\":[{\"url\":\"https:\\/\\/hootsuite-video.s3.amazonaws.com\\/production\\/27546049-VxTLU8Hy.mp4?AWSAccessKeyId=AKIARUFKCQPW7VXGL6EZ&Expires=1754493873&Signature=0T7dWq%2Btg%2F7HPGMCc8WSVnkTy6Y%3D\",\"thumbnailUrl\":\"https:\\/\\/hootsuite-video.s3.amazonaws.com\\/production\\/thumb-0-27546049-VxTLU8Hy.jpeg?AWSAccessKeyId=AKIARUFKCQPW7VXGL6EZ&Expires=1754493873&Signature=pYiiIEw7LS0UMTAIaijDH%2FW6Jno%3D\"}],\"media\":[{\"id\":\"aHR0cHM6Ly9ob290c3VpdGUtdmlkZW8uczMuYW1hem9uY